import react, { Fragment } from "react";
import classes from "./Header.module.css";
import Cart from "../Cart/Cart";
import mealsImage from "../../assets/img/indian-food.jpg";

const Header = () => {
  return (
    <Fragment>
      <header className={classes.header}>
        <h1>ReactMeals</h1>
        <button>Cart</button>
      </header>
      <div>
        <img src={mealsImage} />
      </div>
    </Fragment>
  );
};

export default Header;
